import React from 'react'
import classes from './ShowMeals.module.css'

function ShowMeals(props) {
  return (
    <div className={classes.showMeals} >
        <h4>{props.name} </h4>
        <p>{props.description} </p>
        <p>${props.price} </p>
        <hr />
    </div>
  )
}

export default ShowMeals
